  \"2015-06-17T01:56:58.802234\",\n\t\"name\": \"population-dynamics-and-distribution-of-muskoxen-in-the-arctic-national-wildlife-refuge-al\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report covers the population dynamics
  and distribution of muskoxen in the Arctic National Wildlife Refuge, Alaska. Numbers
  of muskoxen in the Arctic National Wildlife Refuge in northeastern Alaska were estimated
  to be 257 animals prior to calving in April 1983. In November 1983, 311 muskoxen
  were counted. An estimated 64 calves were born between late April and late June
  1983. The study and species are described, followed by the methods and results.
  Maps and data are included.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
